import Container from 'react-bootstrap/Container';
import picture from '../assets/pic.webp';

function AboutLanding() {

    const picture = (
        <div className="col-12 col-md-6 pe-0 pe-md-5 ps-0 my-5">
            <img src={picture} className="img-fluid"></img>
        </div>
    );

    const text = (
        <div className="col-12 col-md-6 ps-0 ps-md-5 my-5">
            <h6 className="display-6 fw-bolder underline w-max">Socials</h6>
            <p className="lead my-3">
                Get in touch with me and follow me on my socials â€“ my latest adventure is just getting started, and you don't want to miss a thing! I'll be posting live updates, stories, and exclusive content.
            </p>
            <div className="d-flex">
                {socialLinks.map((link) => (
                    <a key={link.href} className="pe-3 text-decoration-none text-dark display-6" href={link.href} target='_blank'>
                        <FontAwesomeIcon icon={link.icon} />
                    </a>
                ))}
            </div>
        </div>
    );
    return (
        <>
            <Container>
                <div className='row'>
                    {picture}
                    {text}
                </div>
            </Container>
        </>
    );
}

export default AboutLanding;
